import React from 'react'
import {NavLink} from 'react-router-dom'

const SignedOutLinks = () =>  {
    return ( 
         <ul className="navbar-nav ">
            <li className="nav-item"><NavLink to="/signup" className="nav-link"><span className="glyphicon glyphicon-user"></span>Signup</NavLink></li>
            <li className="nav-item"><NavLink to="/signin" className="nav-link"><span className="glyphicon glyphicon-log-in"></span>Login</NavLink></li>
        </ul>
    );
}
 
export default SignedOutLinks;
